values:
Hey everybody!&nbsp; Its been such a long time since I've even been on this site that I'm not even sure&nbsp;if any of my friends on my list still use this site but nonetheless I will give you all an update.&nbsp; Last April, Lauren and I got an apartment together here in Richmond.&nbsp; I graduated from EKU last May...glad to be done with school.&nbsp; I spent all summer and fall (up until christmas) working 3rd shift at Steak n Shake.&nbsp; The months have flown by since the first of the year.&nbsp; We decided to move back to Ohio, which we are doing this Friday (4-25).&nbsp; We are so excited but dreading it some too.&nbsp; We are truly going to miss the friends we made down here and lets face it...moving is a pain in the ass.&nbsp; We couldn't find a place that we like up there yet so we are moving back in&nbsp; with our parents while we keep looking for that perfect place to call home.&nbsp; I'm so afraid our relationship wont make it since we will be living 30 minutes apart and we have lived together for most of the past 5 years.&nbsp; I know it sounds silly since we have been together for 7 years but I guess I'm scared that we will get too comfortable living our separate lives. I hope we can find a place to live soon so we can make our way back to each other.&nbsp;&nbsp;

Well thats the run down of my life at the moment so if I still have any friends out there give me a holler.

~Amanda
